import React, { Component } from 'react';
import { ReactFlvPlayer } from 'react-flv-player';

class BackDoor extends Component {

  handleError = (err) => {
    switch (err) {
      case 'NetworkError':
        console.log('network error');
        break;
      case 'MediaError':
        console.log('media error');
        break;
      default:
        console.log('other error');
    }
  }

  render() {
    const videoUrl = "http://192.168.1.22:8080/flv?port=1935&app=bcs&stream=channel0_ext.bcs&user=admin&password=Dopple700";

    return (
      <div>
        <ReactFlvPlayer
          url={videoUrl}
          height="200px"
          width="400px"
          isMuted={true}
          handleError={this.handleError}
        />
      </div>
    );
  }
}

export default BackDoor;
